import React from 'react';
import { NavLink } from 'react-router-dom';

const Header = () => {
    return (<>
        <header>
            <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
                <NavLink exact to="/" className="navbar-brand">Live Covid19 Tracker</NavLink>
                <button className="navbar-toggler" data-bs-toggle="collapse" data-bs-target="navbarMenu" aria-expanded="false" aria-label="Toggle navigation"></button>
            </nav>
        </header>
    </>)
}

export default Header;
